package org.dukecon.server.convert.impl

import org.dukecon.adapter.ResourceWrapper
import org.dukecon.server.conference.SpeakerImageService
import org.junit.Before
import org.junit.Test

class SpeakerImageServiceTest {

	SpeakerImageService service

	@Before
	void init() {
		service = new DoagSpeakerImageService()
		assert 'f2c49003d62a22067c421246c497f12f' == service.addImage(ResourceWrapper.of('testimage.jpg').stream.bytes)
		assert '0368b6ac1e03f227ce45b981a166bdae' == service.addImage('')
		assert '996ce9d25653b61b6132b761c4d84435' == service.addImage('')
	}

	@Test
	void testLoadImages() {
		assert service.images.size() == 3
	}

}